		newArray[i] += 1;
		b(newArray);
	}

	return (
		<div className="App">
			<div>
				<p onClick={()=>{asd(0);}}>aaaaaaaa</p>
				<p onClick={()=>{asd(1);}}>bbbbbbbb</p>
				<p>{a[0]}</p>
				<p>{a[1]}</p>
			</div>
		</div>
	);
}

export default App;
